// üéØ ENTRADAS
const homologacionData = $('Transforma Data a JSON').item.json.data;   
const analyzeNode = $('Analyze an image').item.json;

// Extraer texto de la IA
const textoIA = analyzeNode.content?.parts?.[0]?.text || "";

// Limpiar delimitadores de ```json
let jsonString = textoIA
  .replace(/```json/g, '')
  .replace(/```/g, '')
  .trim();

// Intentar extraer solo la parte JSON
if (jsonString.includes('{') && jsonString.includes('}')) {
  const inicio = jsonString.indexOf('{');
  const fin = jsonString.lastIndexOf('}') + 1;
  jsonString = jsonString.substring(inicio, fin);
}

// Parsear
let parsed;
try {
  parsed = JSON.parse(jsonString);
} catch (e) {
  throw new Error("‚ùå No se pudo parsear la salida de Analyze an image: " + e.message + "\nTexto: " + jsonString.substring(0,200));
}

// Obtener PlantillaExtraccion
const datosExtraidos = parsed.PlantillaExtraccion || parsed.datosExtraidos?.PlantillaExtraccion;

if (!homologacionData || !homologacionData.homologacion || !datosExtraidos) {
  return [{
    json: {
      error: "‚ùå No encontr√© 'homologacion' o 'PlantillaExtraccion'",
      keysDisponibles: {
        transforma: Object.keys($('Transforma Data a JSON').item?.json || {}),
        analyze: Object.keys(analyzeNode || {}),
        parsed: Object.keys(parsed || {})
      }
    }
  }];
}

const homologacion = homologacionData.homologacion;
const resultados = [];
const errores = [];

// üîÅ PROCESAR CADA CAMPO
for (const [claveCompleta, valor] of Object.entries(datosExtraidos)) {
  try {
    let codigo;

    // NUEVA L√ìGICA: Extraer todo lo que est√° antes del primer underscore _
    if (claveCompleta.includes('_')) {
      codigo = claveCompleta.split('_')[0].trim();
    } else {
      // Si no hay underscore, usar la clave completa
      codigo = claveCompleta;
    }

    // Buscar en homologaci√≥n
    let celdaDestino = homologacion[codigo];

    // Estrategia 1: si es "+" (suma de c√≥digos)
    if (!celdaDestino && codigo.includes('+')) {
      const codigosIndividuales = codigo.split('+');
      for (const codigoInd of codigosIndividuales) {
        if (homologacion[codigoInd]) {
          celdaDestino = homologacion[codigoInd];
          break;
        }
      }
    }

    // Estrategia 2: si es "-" (resta de c√≥digos)
    if (!celdaDestino && codigo.includes('-') && !codigo.startsWith('-')) {
      const codigosIndividuales = codigo.split('-');
      for (const codigoInd of codigosIndividuales) {
        if (homologacion[codigoInd]) {
          celdaDestino = homologacion[codigoInd];
          break;
        }
      }
    }

    // Estrategia 3: m√∫ltiples negativos tipo "-317-319-321"
    if (!celdaDestino && codigo.match(/^(-\d+){2,}/)) {
      const match = codigo.match(/^(-\d+-?)+/);
      if (match) {
        const codigoLimpio = match[0].replace(/-$/, '');
        const codigosIndividuales = codigoLimpio.split('-').filter(c => c !== '');
        for (const codigoInd of codigosIndividuales) {
          if (homologacion['-' + codigoInd]) {
            celdaDestino = homologacion['-' + codigoInd];
            break;
          }
        }
      }
    }

    // Estrategia 4: clave completa (como respaldo)
    if (!celdaDestino) {
      celdaDestino = homologacion[claveCompleta];
    }

    if (celdaDestino) {
      resultados.push({
        claveOriginal: claveCompleta,
        codigoExtraido: codigo,
        valor,
        celdaDestino,
        status: "success"
      });
    } else {
      errores.push({
        claveOriginal: claveCompleta,
        codigoExtraido: codigo,
        valor,
        error: `C√≥digo "${codigo}" no encontrado en homologaci√≥n`,
        sugerencia: "Verificar si existe en el mapeo de homologaci√≥n"
      });
    }
  } catch (error) {
    errores.push({
      claveOriginal: claveCompleta,
      error: error.message,
      valor
    });
  }
}

